import '../Styling/home.css'
import {Container, Row, Col } from 'reactstrap';
import heroImg from '../images/Hero1.jpeg'
import heroImg2 from '../images/Hero2.jpeg'
import heroVideo from '../images/intro.mp4'
import Subtitle from './../shared/Subtitles';

const Home = () => {
  return <></>
{/* ============ hero Section Start =============*/}
  <section>
    <Container>
      <Row>
        <Col lg = '6'>
          <div className='hero__content'>
            <div className="hero__subtitle d-flex align-items-cennter">
              <Subtitle/>
            </div>
          </div>
        </Col>
      </Row>
    </Container>
  </section>
  {/* ============ hero Section End =============*/}
};

export default Home;
